package abhigaya;

public class Pattern8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		 int i,j,k,n=5;
		 for(i=1;i<=n;++i)
		 {
			 for(k=1;k<=n;++k)
			 {
				System.out.print(" "); 
			 }
			 for(j=1;j<=n;++j)
			 {
				 System.out.print(j); 
			 }
			 System.out.println();
		 }

	}

}
